export function sortCart(arr) {
    var counter = arr.reduce(function (o, i) {
        if (!o.hasOwnProperty(Math.trunc(i.id))) {
            o[Math.trunc(i.id)] = 0;
        }
        o[Math.trunc(i.id)]++;
        console.log(o);

        return o;
    }, {});
    var result = Object.keys(counter).map(function (id) {
        return {
            id: id,
            name: counter.name,
            sum: counter[id]
        };
    });
    return result;



}
